import React from 'react';

const Creators = () => {
  return (
    <div className="w-[1440px] relative bg-white">
      {/* Main Content */}
      <div className="h-[6136px] bg-white">
        <div className="h-[1217px] bg-neutral-50">
          {/* Title Section */}
          <div className="w-[1052.76px] mx-auto text-center">
            <span className="text-black text-[93.93px] font-normal font-['Thunder'] leading-[107.08px] tracking-wide">Join our </span>
            <span className="text-orange-500 text-[93.93px] font-normal font-['Thunder'] leading-[107.08px] tracking-wide">Sweat Equity Partner Program</span>
            <span className="text-black text-[93.93px] font-normal font-['Thunder'] leading-[107.08px] tracking-wide"> and earn money</span>
          </div>

          {/* New Box Section with Play Button */}
          <div className="relative w-[787.5px] h-[361.14px] mx-auto mt-10 bg-zinc-100 rounded-xl border-2 border-black/opacity-5">
            {/* Play Button */}
            <div className="absolute inset-0 flex items-center justify-center">
              <button className="w-16 h-16 bg-white rounded-full border border-black/opacity-5 shadow-lg flex items-center justify-center">
                <svg className="w-8 h-8 text-black" fill="currentColor" viewBox="0 0 24 24">
                  <polygon points="9.5,7.5 16.5,12 9.5,16.5" />
                </svg>
              </button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Creators;
